import { useContext } from 'react';
import { UserContext } from './UserContext';

const UserDisplay = () => {
  const [user, dispatch] = useContext(UserContext);

  return (
    <div>
      <h1>User Info</h1>
      <p>Name: {user.name}</p>
      <p>Age: {user.age}</p>
    </div>
  );
};

export default UserDisplay;
